Magpie
```json
{
  "application": "Magpie",
  "description": "Scripts for running Hadoop on traditional HPC systems.",
  "software": [
    {
      "name": "Java",
      "version": "1.8.0",
      "required": true,
      "environment_variable": "JAVA_HOME"
    },
    {
      "name": "Python",
      "environment_variable": "MAGPIE_PYTHON"
    },
    {
      "name": "Spark",
      "optional": true,
      "environment_variable": "SPARK_SETUP",
      "version": "2.3.0-bin-hadoop2.7",
      "environment_variable": "SPARK_VERSION",
      "home": "${HOME}/spark-${SPARK_VERSION}",
      "environment_variable": "SPARK_HOME",
      "setup_type": [
        "STANDALONE",
        "YARN"
      ],
      "environment_variable": "SPARK_SETUP_TYPE"
    },
    {
      "name": "Zeppelin",
      "optional": true,
      "environment_variable": "ZEPPELIN_SETUP",
      "version": "0.8.2",
      "environment_variable": "ZEPPELIN_VERSION",
      "home": "${HOME}/zeppelin-${ZEPPELIN_VERSION}-bin-all",
      "environment_variable": "ZEPPELIN_HOME"
    }
  ],
  "resource_requirements": {
    "nodes": {
      "description": "Number of nodes to allocate for job, including head node. May include Zookeeper nodes.",
      "environment_variable": "nodes"
    },
    "partition": {
      "description": "Partition of the cluster to use.",
      "environment_variable": "partition"
    },
    "queue": {
      "description": "Batch queue to use for submitting the job.",
      "environment_variable": "queue"
    },
    "walltime": {
      "description": "Walltime for the job. Must be at least the combined sum of MAGPIE_STARTUP_TIME and MAGPIE_SHUTDOWN_TIME.",
      "environment_variable": "walltime"
    },
    "local_storage": {
      "description": "Directory for storing local configuration files and log files. Defaults to /tmp/${USER}/magpie.",
      "environment_variable": "MAGPIE_LOCAL_DIR"
    },
    "remote_shell": {
      "description": "Passwordless remote shell command to launch daemons across the allocation. Defaults to ssh.",
      "environment_variable": "MAGPIE_REMOTE_CMD"
    }
  },
  "job_types": [
    "spark",
    "zeppelin",
    "testall",
    "script",
    "interactive",
    "setuponly"
  ]
}
```
